// SPDX-License-Identifier: GPL-2.0-or-later
pragma solidity >=0.7.6;
pragma experimental ABIEncoderV2;

import "./otp_wallet.sol";
import "./external/walletproxy.sol";
import "./external/create2.sol";
import "./external/signatureutil.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/Address.sol";

contract WalletFactory is Ownable {
    using Address for address payable;

    event WalletCreated(address wallet, address owner);
    event Debug(bytes32 signHash, address addr);

    address public immutable walletImplementation;
    string public constant WALLET_CREATION = "WALLET_CREATION";
    uint256 public feeAmount = 0.09 ether; // 0.09 ONE
    uint public freeUserCap = 1000; 

    struct CreateRecord {
        address wallet;
        string[2] domain;
    }

    CreateRecord[] public created;
    mapping(address => bool) public isFundedWallet;

    struct WalletConfig {
        address resolver;
        string[2] domain;
        address owner;
        bytes32[] rootHash;
        uint8 merkleHeight;
        address drainAddr;
        uint256 dailyLimit;
        uint256 salt;
        // address feeReceipient;
        // uint256 feeAmount;
    }

    struct FundingData {
        address tokenAddress;
        uint amount;
    }

    constructor(address _walletImplementation) {
        walletImplementation = _walletImplementation;
    }

    receive() external payable {}

    function withdraw(address payable to) public onlyOwner {
        uint256 balance = address(this).balance;
        payable(to).sendValue(balance);
    }

    function withdrawErc20(address tokenAddress, address payable to) public onlyOwner {
        uint balance = IERC20(tokenAddress).balanceOf(address(this));
        bool sent = IERC20(tokenAddress).transfer(to, balance);
        require(sent, "Token transfer failed");   
    }

    function createWallet(WalletConfig calldata config) external onlyOwner returns (address wallet) {
        // address found;
        // uint16 ver;
        // (found, ver) =  NameRegistry(this).getContractDetails(config.name);
        // require(found == address(0x0), "REGISTRY MUST BE AVAILABLE");

        address addr = computeWalletAddress(config.owner, config.salt);

        // set feeAmount to 0 for first 1000 users
        if (created.length > freeUserCap) {
            require(addr.balance >= feeAmount, "NOT ENOUGH FOR FEES");
        } else {
            feeAmount = 0;
        }
        // require(NameRegistry(this).registerName(config.name, addr, 1));

        wallet = _deploy(config.owner, config.salt);
        _initializeWallet(wallet, config);

        created.push(CreateRecord(address(wallet), config.domain));
        isFundedWallet[wallet] = false;
        emit WalletCreated(address(wallet), config.owner);
    }

    // send initial ONE&ERC20 tokens to user's wallet 
    function initialPortfolioFunding(address wallet, FundingData[] calldata fundingTokens, uint ONEAmount) external onlyOwner {
        require(!isFundedWallet[wallet], "this wallet is already funded");

        // fund ERC20 toknes
        for (uint i=0; i< fundingTokens.length; i++) {
            FundingData calldata token = fundingTokens[i];
            bool sent = IERC20(token.tokenAddress).transfer(wallet, token.amount);
            require(sent, "Token transfer failed");   
        }

        isFundedWallet[wallet] = true;

        // fund ONE at last
        payable(wallet).sendValue(ONEAmount);
    }

    function computeWalletAddress(address owner, uint256 salt) public view returns (address) {
        return Create2.computeAddress(keccak256(abi.encodePacked(WALLET_CREATION, owner, salt)), getWalletCode());
    }

    function getCreated() public view returns (CreateRecord[] memory) {
        return created;
    }

    // --- Internal functions ---

    function _initializeWallet(address wallet, WalletConfig calldata config) internal {
        address feeReceipient = msg.sender;

        TOTPWallet(payable(wallet)).initialize(
            config.resolver,
            config.domain,
            config.owner,
            config.rootHash,
            config.merkleHeight,
            payable(config.drainAddr),
            config.dailyLimit,
            feeReceipient,
            feeAmount
        );

        //TOTPWallet(payable(wallet)).registerENS(config.subdomain, config.domain, config.duration);
    }

    function _deploy(address owner, uint256 salt) internal returns (address payable wallet) {
        // Deploy the wallet proxy
        wallet = Create2.deploy(keccak256(abi.encodePacked(WALLET_CREATION, owner, salt)), getWalletCode());
    }

    function getWalletCode() internal view returns (bytes memory) {
        return abi.encodePacked(type(WalletProxy).creationCode, abi.encode(walletImplementation));
    }
}
